        ViewItemPage.AddToCardAndGoBack();
 });
     Then(/^I click on other item$/, () => {
         browser.pause(4000)
         ViewItemPage.item_3.click();
});
     Then(/^I get redirected back to The View Item Page$/, () => {
         browser.pause(4000)
         browser.waitUntil(() => ViewItemPage.addToCartBtn.isDisplayed());
});
     Then(/^I can add item to Cart and continue shopping$/, () => {
         browser.pause(4000)
         ViewItemPage.AddToCardAndGoBack();
});
    When(/^I can click on shopping cart button$/, () => {
        browser.pause(3000)
        ViewItemPage.shoppingCardBtn.click();
    })

    Then (/^I can view shopping cart with items$/, () => {
        browser.pause(3000)
    expect(ViewItemPage.item_4).toBeDisplayed();
    expect(ViewItemPage.item_3).toBeDisplayed();
});
    Then(/^I can remove first item from shopping cart$/, () => {
        browser.pause(3000)
       ViewItemPage.removeBtn.click();
});
    Then(/^I can continue shopping$/, () => {
        browser.pause(3000)
        ViewItemPage.continueShopping.click();
});
    Then(/^I can add another item to the shopping cart from Home Page$/, () => {
        browser.pause(3000)
        browser.waitUntil(() => ViewItemPage.item_0.isDisplayed());
        ViewItemPage.item_0_AddToCart.click();
});
    When(/^I can click on shopping cart btn$/, () => {
        ViewItemPage.shoppingCardBtn.click();
        browser.pause(3000)
});
    Then(/^I can view just added item in the shopping cart$/, () => {
        expect(ViewItemPage.item_0).toBeDisplayed();
});

